import React from "react";
import styled from "styled-components";
import HeaderLinks from "./Constants";

const HeaderNavLink = styled.a.attrs({
  className: ` ${props =>
    props.isButton &&
    "cursor-pointer font-light text-white whitespace-no-wrap"} no-underline`
})`
  margin-left: 20px;
  color: ${props => (props.active ? "#121212" : "hsla(0,0%,7%,.5)")};
  font-size: 16px;
  @media (min-width: 1020px) {
    font-size: 18px;
  }
  ${props =>
    props.isButton &&
    `
    font-family: FuturaBT-Book, sans-serif;
  font-size: 18px;
  background: #ffb21a;
  border-radius: 52px;
  padding: 16px 20px 15px;
  transition: background 80ms linear, opacity 1s linear;`}
`;

const Button = styled.a.attrs({
  className:
    "cursor-pointer font-light text-white no-underline whitespace-no-wrap"
})`
  font-family: FuturaBT-Book, sans-serif;
  font-size: 18px;
  background: #ffb21a;
  border-radius: 52px;
  padding: 16px 20px 15px;
  transition: background 80ms linear, opacity 1s linear;
`;
const HeaderNav = () => (
  <nav className="lg:block md:block hidden">
    <ul className="flex justify-end">
      {HeaderLinks.map((link, index) => (
        <li key={index}>
          {link.isButton ? (
            <Button>{link.name}</Button>
          ) : (
            <HeaderNavLink active={link.active}>{link.name}</HeaderNavLink>
          )}
        </li>
      ))}
    </ul>
  </nav>
);

export default HeaderNav;
